import React from "react";
import "./Style/LandingPage.css";
const LandingPage = () => {
  return (
  
      <div className="container-1">
        <form>
          <h2>User Login</h2>
          <dl>
            <dt>User Name</dt>
            <dd>
              <input type="text" placeholder="Enter Your ID" />
            </dd>
            <dt>Password</dt>
            <dd>
              <input type="password" placeholder="Enter Your Password" />
            </dd>
          </dl>
          <button>Login</button>
        </form>
      </div>

  );
};

export default LandingPage;
